import React, { useEffect } from "react";

const { kakao } = window;

function Map() {
  useEffect(() => {
    let mapContainer = document.getElementById("map"); //지도 표시 div

    let mapOption = {
      center: new kakao.maps.LatLng(33.450701, 126.570667), //지도 중심 좌표
      level: 3, //지도 확대 레벨
    };

    var map = new kakao.maps.Map(mapContainer, mapOption);
  });

  return <div id="map" style={{ width: "80%", height: "80%" }}></div>;
}

export default Map;
